import React from 'react';

import {
  BrowserRouter as Router,
    Route,
    Link
} from "react-router-dom";

import './styles/App.css';
import SignUp from "./components/signup";

function App() {
  return (
      <Router>
        <div className={"section"}>
          <Route path={"/signup"} component={SignUp} />
        </div>
      </Router>
  );
}

export default App;
